function addCookie(a,b){document.cookie=encodeURIComponent(a)+"="+encodeURIComponent(b)}function getCookie(a){return(a=document.cookie.match(new RegExp("(?:^|; )"+a.replace(/([\.$?*|{}\(\)\[\]\\\/\+^])/g,"\\$1")+"=([^;]*)")))?decodeURIComponent(a[1]):""}function deleteCookie(a){var b=new Date;b.setTime(b.getTime()-1);document.cookie=a+("=; expires="+b.toGMTString())};
